import React from 'react';
import { Switch, Route } from 'react-router-dom';


function App() {
  return (
    <Switch>
      <Route exact path="/">
        {/* <HomePage /> */}
      </Route>
      <Route path="/about">
        {/* <AboutPage /> */}
      </Route>
      <Route path="/contact">
        {/* <ContactPage /> */}
      </Route>
    </Switch>
  );
}

export default App;
